import React from 'react';

function ProductList({item: shoes}) {
    const { image, name, price } = shoes;
    return (
        <div className="m-auto col-lg-4 col-md-5"  style={{ height: 500 }}>
            <div className="border">
                <img src={ image } alt={ name } style={{ height: 300 }}/>
                <div>
                    <h3>{ name }</h3>
                    <p>{ price }</p>
                </div>
            </div>
        </div>
    );
}

export default ProductList;
